import React, { Component } from 'react';
import './App.css';
import Timer from "./Timer";
import Radio from "./Radio";
import questions from "./questions.json";

class App extends Component {

  state = {
    questions
  };




  render() {
    return (
      <div className="App">

        <div className="wrapper">

          <div className="timer">
            <h1>Pixar Trivia!</h1>
            <Timer />
          </div>

          {/* three pages */}
          {/* landing-timer start */}
          {/* questions */}
          {/* results */}

          <div id="questions">
            {this.state.questions.map(question => (
              <p
                id={question.id}
                key={question.id}
                text={question.text}
              />
            ))}
          </div>







          <div className="questions">
            <h3>Hello</h3>
            <Radio />
          </div>


        </div>

      </div>
    );
  }
}

export default App;
